script: |
  super -f text -I q12832.spq | sort > q12832.out

inputs:
  - name: q12832.spq
    data: |
      SELECT DISTINCT col2 AS col2 FROM tab0 (FORMAT parquet) AS cor0 WHERE + col1 * + ( - col0 ) NOT BETWEEN ( col1 + + col2 ) AND NULL;
  - name: tab0

outputs:
  - name: q12832.out
    data: |
      10
      47
      99
